import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import MainWindow from './components/MainWindow';

function App() {
  return (
    <div>
      <Header />
      <MainWindow />
      <Footer />
    </div>
  );
}

export default App;
